export default{
	data() {
		return {

		}
	},
	props:{
		page_total:{
			type:[Number,String],
			default:30
		},
		current_page:{
			type:[Number,String],
			default:1
		}
		
	},
	computed: {
	  page: {
		get () {
		  return this.current_page
		},
		set (val) {
			this.$emit('changePage',val);
		}
	  },
	},
	methods:{
		watchInput(val){
			if(Number(val.target.value)<= this.page_total){
				this.page = val.target.value;
			}else{
				this.page = this.page_total;
			}
			
		}
	}

}
